function Navigation(){
    return (
        <div class="nav">
         <h3 class="masthead-brand"><img src="http://timothy.expert/images/logo.svg?v=1" alt="Code" class="img-responsive logo"/> Timothy.Expert</h3>
  <a href="#home">Port</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>

   </div>
     
    )
}
export default Navigation
